import { Injectable, NotFoundException } from '@nestjs/common';
import { Recommendation } from 'src/schemas/recommendation.schema';
import { InjectModel } from '@nestjs/mongoose';

import { Model } from 'mongoose';
import { User } from 'src/schemas/user.schema';
import { Course } from 'src/schemas/course.schema';

@Injectable()
export class RecommendationService {
  constructor(
    @InjectModel(Recommendation.name, 'eLearningDB')
    private readonly recommendationModel: Model<Recommendation>,
    @InjectModel(User.name, 'eLearningDB')
    private readonly userModel: Model<User>,
    @InjectModel(Course.name, 'eLearningDB')
    private readonly courseModel: Model<Course>
  ) {}

  
  private readonly allCourses = [
    { title: 'Advanced Data Science', category: 'Data Science', creditHours: 4, price: 300, imageUrl: 'data:image/jpeg;base64,' },
    { title: 'AI and Machine Learning', category: 'Data Science', creditHours: 5, price: 400, imageUrl: 'data:image/jpeg;base64,' },
    { title: 'Data Visualization', category: 'Data Science', creditHours: 3, price: 200, imageUrl: 'data:image/jpeg;base64,' },
    { title: 'Big O Data', category: 'Data Science', creditHours: 4, price: 350, imageUrl: 'data:image/jpeg;base64,' },
    { title: 'Cloud Computing Basics', category: 'Data Science', creditHours: 4, price: 250, imageUrl: 'data:image/jpeg;base64,' },
  ];

  // Method to generate recommendations based on the accepted courses
  async generateRecommendations(userEmail: string): Promise<Recommendation[]> {
    // Get the user by email
    const user = await this.userModel.findOne({ email: userEmail }).exec();
    
    if (!user) {
      throw new Error('User not found');
    }

    // Get the categories of the user's accepted courses
    const categories = await Promise.all(
      user.acceptedCourses.map(async (courseTitle) => {
        const category = await this.getCategoryByTitle(courseTitle);
        return category;
      }),
    );

    // Remove duplicates from the categories
    const uniqueCategories = Array.from(new Set(categories));

    // Filter courses from the predefined list that match the user's accepted course categories
    const recommendedCourses = this.allCourses.filter(course => uniqueCategories.includes(course.category));

    // Create recommendations based on the filtered courses
    const recommendations = recommendedCourses.map(course => {
      return new this.recommendationModel({
        title: course.title,
        category: course.category,
        creditHours: course.creditHours,
        price: course.price,
        imageUrl: course.imageUrl,
      });
    });

    return recommendations;
  }

  // Helper method to fetch course category by title
  private async getCategoryByTitle(title: string): Promise<string | null> {
    const course = await this.courseModel.findOne({ title }).exec();
    return course ? course.category : null; // Return category or null if course is not found
  }

  async fetchRecommendationsByEmail(email: string): Promise<Recommendation[]> {
    // Find the user by email
    const user = await this.userModel.findOne({ email }).exec();

    if (!user) {
      throw new NotFoundException(`User with email ${email} not found.`);
    }

    // Get categories of accepted courses
    const acceptedCategories = user.acceptedCourses;

    // Fetch recommendations that match the user's accepted course categories
    const recommendations = await this.recommendationModel
      .find({ category: { $in: acceptedCategories } })
      .exec();

    return recommendations;
  }

  // Mark a recommendation as viewed by email and course title
  async markAsViewed(studentEmail: string, courseTitle: string): Promise<Recommendation> {
    const recommendation = await this.recommendationModel.findOneAndUpdate(
      { StudentEmail: studentEmail, courseTitle },
      { isViewed: true },
      { new: true },
    );
    if (!recommendation) {
      throw new NotFoundException('Recommendation not found');
    }
    return recommendation;
  }

  // Accept a recommendation by email and course title
  async acceptRecommendation(studentEmail: string, courseTitle: string): Promise<Recommendation> {
    const recommendation = await this.recommendationModel.findOneAndUpdate(
      { StudentEmail: studentEmail, courseTitle },
      { isAccepted: true },
      { new: true },
    );
    if (!recommendation) {
      throw new NotFoundException('Recommendation not found');
    }
    return recommendation;
  }
}
